var n='<div class="card" data-note-id="{{id}}">\n  <div class="card-header">\n    {{{badges.user}}}\n    {{{badges.age}}}\n    {{{badges.comments}}}\n    {{#expert}}{{{badges.country}}}{{/expert}}\n    {{{badges.report}}}\n  </div>\n\n  <div class="card-body text-break">\n    {{{comment}}}\n  </div>\n\n  <div class="card-footer">\n    {{#each actions}}\n      {{#if link}}\n      <a class="btn btn-primary btn-sm my-1 {{class}}" href="{{link}}"\n        {{#remote}}target="remote"{{else}}target="_blank" rel="noopener"{{/remote}}>\n        <svg class="icon"><use xlink:href="#icon-{{icon}}"></use></svg>\n        {{text}}\n      </a>\n      {{else}}\n      <button class="btn btn-primary btn-sm my-1 {{class}}">\n        <svg class="icon"><use xlink:href="#icon-{{icon}}"></use></svg>\n        {{text}}\n      </button>\n      {{/if}}\n    {{/each}}\n  </div>\n</div>\n';export{n as t};
